import React from "react";

// import { useContext } from "react";
// import ApiContext from "../../store/api-contex";
// import { useHttp } from "../../hooks/useHttp";

import classes from "./MovieList.module.css";
import Movie from "./Movie";
export default function MovieList({ backdrop, movData }) {
  // const requests = useContext(ApiContext);
  return (
    <div className={classes["mov-list"]}>
      <ul>
        {movData.results.map((data) => (
          <Movie backdrop={backdrop} key={data.id} movData={data}></Movie>
        ))}
      </ul>
      <div></div>
    </div>
  );
}
